define({"topics" : [{"title":"Park Calls by BLF","shortdesc":"\n                  <p class=\"shortdesc\">You can set a BLF key of Call Parking on your phone. The BLF key will show the         real-time status of the parking slot.\n                     If the parking slot is vacant, you can press the BLF         key to park a call to the parking slot.\n                  </p>\n               ","id":"task_ud3_43r_bdb","href":"topic\/park_calls_by_blf.html","menu": {"hasChildren":false,},"tocID":"task_ud3_43r_bdb-d46e13770","topics":[]},{"title":"Configure Call Parking Caller ID","shortdesc":"\n                  <p class=\"shortdesc\">By default, when you retrieve a parked call, the call-park slot number (e.g. 6900)         will be displayed on the phone.\n                     To display the original caller ID of the user who you were         talking to, you need to configure SIP settings to get caller\n                     ID from Remote- Party-ID SIP         header.\n                  </p>\n               ","id":"topic_dzk_jz1_rfb","href":"topic\/configure_call_parking_caller_id.html","menu": {"hasChildren":false,},"tocID":"topic_dzk_jz1_rfb-d46e13841","topics":[]}]});